 async function getContestData(){
  const Data = await fetch('https://kontests.net/api/v1/all')
  const Contest = await Data.json();
  return Contest;
}

function App() {
  const data = getContestData();
  data.then(dat => console.log(dat));
  return 'hiohdaso';
}

export default App;
